package xfp.java.test.numbers;

import java.math.BigInteger;

import org.junit.jupiter.api.Test;

import xfp.java.Debug;
import xfp.java.numbers.UnNatural;
import xfp.java.test.Common;

//----------------------------------------------------------------
/** Test desired properties of natural number implementations.
 * <p>
 * <pre>
 * mvn -q -Dtest=xfp/java/test/numbers/NaturalTest test > NaturalTest.txt
 * </pre>
 *
 * @author palisades dot lakes at gmail dot com
 * @version 2019-05-30
 */

public final class NaturalTest {

  @SuppressWarnings({ "static-method" })
  @Test
  public final void unNatural () {
    Debug.DEBUG = false;

    final BigInteger z0 = new BigInteger(
      "",
      0x10);
    final BigInteger z1 = new BigInteger(
      "",
      0x10);
    Common.naturalTest(
      UnNatural::valueOf,
      UnNatural::valueOf,
      (z) -> ((UnNatural) z).bigIntegerValue(),
      z0,z1); 

    Common.naturalTest(
      UnNatural::valueOf,
      UnNatural::valueOf,
      (z) -> ((UnNatural) z).bigIntegerValue()); 

    Debug.DEBUG = false; }

  //--------------------------------------------------------------
}
//--------------------------------------------------------------
